function nCr(n, r) {
    if (r > n / 2) {
        r = n - r;
    }
    let answer = 1;
    for (let i = 1; i <= r; i++) {
        answer *= (n - r + i);
        answer /= i;
    }
    return answer;
}

function binomialProbability(n, k, p) {
    return (nCr(n, k) * Math.pow(p, k) * Math.pow(1 - p, n - k));
}
